
var backgroundImage = "data:image/png;base64,";

var loadingBarBg = "data:image/png;base64,";


LoaderScene = cc.Scene.extend({
    _interval : null,
    _label : null,
    _loadingBar : null,
    _className:"LoaderScene",
    cb: null,
    target: null,
    init : function(){
        this.setVisible(true);
        var self = this;
        var fontSize = 24;
        if(backgroundImage){
            cc.loader.loadImg(backgroundImage, {isCrossOrigin : false }, function(err, img){
                self._initStage(img, cc.visibleRect.center);
            });
        }
        var label = self._label = new cc.LabelTTF("Loading... 0%", "Arial", fontSize);
        label.setPosition(cc.pAdd(cc.visibleRect.center, cc.p(0, 0)));
        label.setColor(cc.color(180, 180, 180));
        this.addChild(this._label, 11);

        //var loadingBar = this._loadingBar = new ccui.LoadingBar();
        //loadingBar.setName("LoadingBar");
        ////loadingBar.loadTexture("resources/HD/ui/sliderProgress");
        //loadingBar.setPercent(50);
        //loadingBar.setPosition(cc.pAdd(cc.visibleRect.center, cc.p(0, 0)));
        //this.addChild(loadingBar, 11);

        return true;
    },
    _initStage: function (img, centerPos) {
        var self = this;
        var texture2d = self._texture2d = new cc.Texture2D();
        texture2d.initWithElement(img);
        texture2d.handleLoadedTexture();
        var logo = self._logo = new cc.Sprite(texture2d);
        logo.setScale(cc.contentScaleFactor());
        logo.x = centerPos.x;
        logo.y = centerPos.y;
        this.addChild(logo, 10);
    },
    onEnter: function () {
        var self = this;
        cc.Node.prototype.onEnter.call(self);
        self.schedule(self._startLoading, 0.3);
    },
    onExit: function () {
        cc.Node.prototype.onExit.call(this);
        var tmpStr = "Loading... 0%";
        this._label.setString(tmpStr);
    },
    initWithResources: function (resources, cb, target) {
        if(cc.isString(resources))
            resources = [resources];
        this.resources = resources || [];
        this.cb = cb;
        this.target = target;
    },
    _startLoading: function () {
        var self = this;
        self.unschedule(self._startLoading);
        var res = self.resources;
        cc.loader.load(res,
            function (result, count, loadedCount) {
                var percent = (loadedCount / count * 100) | 0;
                percent = Math.min(percent, 100);
                self._label.setString("Loading: ... " + percent + "%");
            }, function () {
                if (self.cb)
                    self.cb.call(self.target);
            });
    },
});
LoaderScene.preload = function(resources, cb, target){
    var _cc = cc;
    if(!_cc.loaderScene) {
        _cc.loaderScene = new LoaderScene();
        _cc.loaderScene.init();
    }
    _cc.loaderScene.initWithResources(resources, cb, target);
    cc.director.runScene(_cc.loaderScene);

    return _cc.loaderScene;
};